import Header from "../../Components/header/Header";
import Footer from "../../Components/footer/Footer";

const Layout = () => {
    return (
        <div className="flex flex-col min-h-screen">
            <div>
                <Header />
                <div className="flex-grow">
                    <Outlet />
                </div>
                <Footer />
            </div>
        </div>
    );
}
export default Layout;
